using System.Diagnostics;
using System.Globalization;
using System.Text;
using System.Text.RegularExpressions;

namespace Sunspot.Core.Helper.ClassExtensions;

public static class StringExtension
  {
    private static bool IsMatch(this string value, string pattern, bool isContains = true)
    {
      return value != null && (isContains ? Regex.IsMatch(value, pattern) : Regex.Match(value, pattern).Success);
    }
    
    /// <summary>
    /// 根据正则获取字符串匹配内容
    /// </summary>
    /// <param name="value"></param>
    /// <param name="pattern"></param>
    /// <returns></returns>
    public static string Match(this string value, string pattern)
    {
      return value == null ? null : Regex.Match(value, pattern).Value;
    }

    private static IEnumerable<string> Matches(this string value, string pattern)
    {
      return value == null
        ? new string[0]
        : Regex.Matches(value, pattern)
          .Select(
            match => match.Value);
    }
    
    /// <summary>
    /// 获取字符串的第一个数字
    /// </summary>
    /// <param name="value"></param>
    /// <returns></returns>
    public static string MatchFirstNumber(this string value)
    {
      MatchCollection matchCollection = Regex.Matches(value, "\\d+");
      return matchCollection.Count == 0 ? string.Empty : matchCollection[0].Value;
    }
    
    /// <summary>
    /// 获取字符串的最后一个数字
    /// </summary>
    /// <param name="value"></param>
    /// <returns></returns>
    public static string MatchLastNumber(this string value)
    {
      MatchCollection matchCollection = Regex.Matches(value, "\\d+");
      return matchCollection.Count == 0 ? string.Empty : matchCollection[matchCollection.Count - 1].Value;
    }
    
    /// <summary>
    /// 获取字符串的所有数字
    /// </summary>
    /// <param name="value"></param>
    /// <returns></returns>
    public static IEnumerable<string> MatchNumbers(this string value)
    {
       return value.Matches("\\d+");
    }
  
    /// <summary>
    /// 判断字符串是否是数字
    /// </summary>
    /// <param name="value"></param>
    /// <returns></returns>
    public static bool IsMatchNumber(this string value)
    {
      return value.IsMatch("\\d");
    }

    /// <summary>
    /// 判断字符串是否是中文
    /// </summary>
    /// <param name="value"></param>
    /// <returns></returns>
    [DebuggerStepThrough]
    public static bool IsMatchChinese(this string value)
    {
      return value.IsMatch("[\\u4e00-\\u9fa5]");
    }
    
    /// <summary>
    /// 判断数字长度
    /// </summary>
    /// <param name="value"></param>
    /// <param name="length">长度</param>
    /// <returns></returns>
    public static bool IsMatchNumber(this string value, int length)
    {
      return new Regex(" ^\\d{" + length.ToString() + "}$").IsMatch(value);
    }
    
    /// <summary>
    /// 截取两个字符串之间的内容
    /// </summary>
    /// <param name="value"></param>
    /// <param name="startString"></param>
    /// <param name="endString"></param>
    /// <returns></returns>
    public static string Substring(this string value, string startString, string endString)
    {
      return new Regex("(?<=(" + startString + "))[.\\s\\S]*?(?=(" + endString + "))",
        RegexOptions.Multiline | RegexOptions.Singleline).Match(value).Value;
    }
    
    /// <summary>
    /// 匹配两个字符串是否相等，忽略大小写
    /// </summary>
    /// <param name="value"></param>
    /// <param name="value2"></param>
    /// <returns></returns>
    public static bool EqualsIgnoreCase(this string value, string value2)
    {
      return string.Equals(value, value2, StringComparison.OrdinalIgnoreCase);
    }

    public static bool IsEmail(this string value) => value.IsMatch("^[\\w-]+(\\.[\\w-]+)*@[\\w-]+(\\.[\\w-]+)+$");

    public static bool IsIpAddress(this string value) => value.IsMatch("^((?:(?:25[0-5]|2[0-4]\\d|((1\\d{2})|([1-9]?\\d)))\\.){3}(?:25[0-5]|2[0-4]\\d|((1\\d{2})|([1-9]?\\d))))$");

    public static bool IsNumeric(this string value) => value.IsMatch("^\\-?[0-9]+$");

    public static bool IsUnicode(this string value) => value.IsMatch("^[\\u4E00-\\u9FA5\\uE815-\\uFA29]+$");

    public static bool IsUrl(this string value) => value.IsMatch("^(http|https|ftp|rtsp|mms):(\\/\\/|\\\\\\\\)[A-Za-z0-9%\\-_@]+\\.[A-Za-z0-9%\\-_@]+[A-Za-z0-9\\.\\/=\\?%\\-&_~`@:\\+!;]*$");

    public static bool IsIdentityCard(this string value)
    {
      if (value.Length != 15 && value.Length != 18)
        return false;
      DateTime result;
      if (value.Length == 15)
      {
        Regex regex = new Regex("^(\\d{6})(\\d{2})(\\d{2})(\\d{2})(\\d{3})_");
        if (!regex.Match(value).Success)
          return false;
        string[] strArray = regex.Split(value);
        return DateTime.TryParse(string.Format("{0}-{1}-{2}", (object) ("19" + strArray[2]), (object) strArray[3], (object) strArray[4]), out result);
      }
      Regex regex1 = new Regex("^(\\d{6})(\\d{4})(\\d{2})(\\d{2})(\\d{3})([0-9Xx])$");
      if (!regex1.Match(value).Success)
        return false;
      string[] strArray1 = regex1.Split(value);
      if (!DateTime.TryParse(string.Format("{0}-{1}-{2}", (object) strArray1[2], (object) strArray1[3], (object) strArray1[4]), out result))
        return false;
      string[] array = ((IEnumerable<char>) value.ToCharArray()).Select<char, string>((Func<char, string>) (m => m.ToString())).ToArray<string>();
      int[] numArray = new int[17]
      {
        7,
        9,
        10,
        5,
        8,
        4,
        2,
        1,
        6,
        3,
        7,
        9,
        10,
        5,
        8,
        4,
        2
      };
      int num1 = 0;
      for (int index = 0; index < 17; ++index)
      {
        int num2 = int.Parse(array[index]);
        num1 += num2 * numArray[index];
      }
      int index1 = num1 % 11;
      string str = ((IEnumerable<char>) "10X98765432".ToCharArray()).ElementAt<char>(index1).ToString();
      return ((IEnumerable<string>) array).Last<string>().ToUpper() == str;
    }

    public static bool IsMobileNumber(this string value, bool isRestrict = false)
    {
      string pattern = isRestrict ? "^[1][3-8]\\d{9}$" : "^[1]\\d{10}$";
      return value.IsMatch(pattern);
    }

    public static byte[] GetBytes(this string value, Encoding encoding = null)
    {
      if (value == null)
        return (byte[]) null;
      if (value == string.Empty)
        return new byte[0];
      if (encoding == null)
        encoding = Encoding.UTF8;
      return encoding.GetBytes(value);
    }

    public static bool EqualIgnoreCase(this string value, params string[] strs)
    {
      foreach (string str in strs)
      {
        if (string.Equals(value, str, StringComparison.OrdinalIgnoreCase))
          return true;
      }
      return false;
    }

    public static string ToBase64String(this byte[] bytes) => Convert.ToBase64String(bytes);

    public static string SafeString(this object input) => input?.ToString().Trim() ?? string.Empty;

    public static string ToBase64String(this string source, Encoding encoding = null)
    {
      if (encoding == null)
        encoding = Encoding.UTF8;
      return Convert.ToBase64String(encoding.GetBytes(source));
    }

    public static string ToMd5Hash(this string value) => HashHelper.GetMd5(value);

    [DebuggerStepThrough]
    public static bool IsNullOrEmpty(this string value) => string.IsNullOrEmpty(value);

    [DebuggerStepThrough]
    public static bool IsNullOrWhiteSpace(this string value) => string.IsNullOrWhiteSpace(value);

    public static T FromJsonString<T>(this string json)
    {
      json.CheckNotNull<string>(nameof (json));
      return JsonConvert.DeserializeObject<T>(json);
    }

    public static object FromJsonString(this string json, Type type)
    {
      json.CheckNotNull<string>(nameof (json));
      return JsonConvert.DeserializeObject(json, type);
    }

    [DebuggerStepThrough]
    public static string FormatWith(this string format, params object[] args)
    {
      format.CheckNotNull<string>(nameof (format));
      return string.Format((IFormatProvider) CultureInfo.CurrentCulture, format, args);
    }

    public static string ReverseString(this string value)
    {
      value.CheckNotNull<string>(nameof (value));
      return new string(value.Reverse<char>().ToArray<char>());
    }

    public static bool IsImageFile(this string filename)
    {
      if (!File.Exists(filename))
        return false;
      byte[] numArray = File.ReadAllBytes(filename);
      if (numArray.Length == 0)
        return false;
      switch (BitConverter.ToUInt16(numArray, 0))
      {
        case 18759:
        case 19778:
        case 20617:
        case 55551:
          return true;
        default:
          return false;
      }
    }

    public static string[] Split(this string value, string strSplit, bool removeEmptyEntries = false) => value.Split(new string[1]
    {
      strSplit
    }, (StringSplitOptions) (removeEmptyEntries ? 1 : 0));

    public static string GetMd5(this string value) => HashHelper.GetMd5(value);

    public static string EncryptBase64(this string data) => Convert.ToBase64String(Encoding.UTF8.GetBytes(data));

    public static string DecryptBase64(this string data) => Encoding.UTF8.GetString(Convert.FromBase64String(data));

    public static int TextLength(this string value)
    {
      if (value.IsNullOrWhiteSpace())
        return 0;
      ASCIIEncoding asciiEncoding = new ASCIIEncoding();
      int num1 = 0;
      foreach (byte num2 in asciiEncoding.GetBytes(value))
      {
        if (num2 == (byte) 63)
          num1 += 2;
        else
          ++num1;
      }
      return num1;
    }

    public static string AddUrlQuery(this string url, params string[] queries)
    {
      foreach (string query in queries)
      {
        if (!url.Contains("?"))
          url += "?";
        else if (!url.EndsWith("&"))
          url += "&";
        url += query;
      }
      return url;
    }

    public static string GetUrlQuery(this string url, string key)
    {
      if (url.IsNullOrWhiteSpace())
        return url;
      string query = new Uri(url).Query;
      if (query.IsNullOrEmpty())
        return string.Empty;
      Dictionary<string, string> dictionary = ((IEnumerable<string>) query.TrimStart('?').Split("&", true)).Select(m => new
      {
        m = m,
        strs = m.Split("=")
      }).Select(_param1 => new KeyValuePair<string, string>(_param1.strs[0], _param1.strs[1])).ToDictionary<KeyValuePair<string, string>, string, string>((Func<KeyValuePair<string, string>, string>) (m => m.Key), (Func<KeyValuePair<string, string>, string>) (m => m.Value));
      return dictionary.ContainsKey(key) ? dictionary[key] : string.Empty;
    }

    public static string GetHostUrl(this string url)
    {
      if (url.IsNullOrWhiteSpace())
        return url;
      try
      {
        string empty = string.Empty;
        if (url.Contains("%"))
          empty = url.Split('%')[1];
        else if (url.Contains("}"))
          empty = url.Split('}')[0].Split('{')[1];
        if (!empty.IsNullOrEmpty())
        {
          string newValue = AppConfigManager.Get("Iduo:Setting:" + empty);
          url = url.Replace("%" + empty + "%", newValue).Replace("{" + empty + "}", newValue);
        }
      }
      catch (Exception ex)
      {
      }
      return url;
    }

    public static string AddHashFragment(this string url, string query)
    {
      if (!url.Contains("#"))
        url += "#";
      return url + query;
    }

