    public static string FirstCharToUpper(this string value) => value.IsNullOrEmpty() ? value : value.First<char>().ToString().ToUpper() + value.Substring(1);

    public static string GetConnectionStringSchemaName(this string connectionString, bool toUpper = true)
    {
      if (connectionString.IsNullOrWhiteSpace() || !connectionString.Contains(";"))
        return (string) null;
      foreach (string str1 in ((IEnumerable<string>) connectionString.Split(';')).ToList<string>())
      {
        if (!str1.IsNullOrWhiteSpace() && str1.Contains("="))
        {
          string[] strArray = str1.Trim().Split('=');
          string str2 = strArray[0];
          string str3 = strArray[1];
          if (str2.EqualIgnoreCase("user id"))
            return toUpper ? str3.ToUpper() : str3;
        }
      }
      return (string) null;
    }

    public static string GetChineseSpell(this string strText)
    {
      if (string.IsNullOrEmpty(strText))
        return strText;
      StringBuilder stringBuilder = new StringBuilder();
      foreach (char c in strText)
      {
        if (c >= 'a' && c <= 'z' || c >= 'A' && c <= 'Z')
          stringBuilder.Append(char.ToUpper(c));
        else if (c >= '一' && c <= '龥')
          stringBuilder.Append(""[(int) c - 19968]);
      }
      return stringBuilder.ToString();
    }

    public static string GetFirstPinyin(this string strText)
    {
      if (string.IsNullOrEmpty(strText))
        return strText;
      string empty = string.Empty;
      char ch = strText.ToCharArray()[0];
      if (ch >= 'a' && ch <= 'z' || ch >= 'A' && ch <= 'Z')
        empty = ch.ToString();
      else if (ch >= '一' && ch <= '龥')
        empty = ""[(int) ch - 19968].ToString();
      return empty;
    }

    public static string AddFirstPinyin(this string str)
    {
      if (string.IsNullOrEmpty(str))
        return string.Empty;
      char ch = str.ToCharArray()[0];
      return ch >= 'a' && ch <= 'z' || ch >= 'A' && ch <= 'Z' || ch < '一' || ch > '龥' ? str : ""[(int) ch - 19968].ToString() + str;
    }
  }